description: "```\n\nThis is the readme for th model associated with the papers:\n\
  \n1. Huang et al., The synergistic inhibitory actions of oxcarbazepine\n   on voltage-\
  \ gated sodium and potassium currents in differentiated\n   NG108-15 neuronal cells\
  \ and model neurons. Int J\n   Neuropsychopharmacol 2008;11:597-610.\n\nAbstract:\n\
  \nOxcarbazepine (OXC), one of the newer anti-epileptic drugs, has been\ndemonstrating\
  \ its efficacy on wide-spectrum neuropsychiatric\ndisorders. However, the ionic\
  \ mechanism of OXC actions in neurons\nremains incompletely understood. With the\
  \ aid of patch-clamp\ntechnology, we first investigated the effects of OXC on ion\
  \ currents\nin NG108-15 neuronal cells differentiated with cyclic AMP. We found\n\
  OXC (0.3-30 mum) caused a reversible reduction in the amplitude of\nvoltage-gated\
  \ Na+ current (INa).  The IC50 value required for the\ninhibition of INa by OXC\
  \ was 3.1 mum. OXC (3 mum) could shift the\nsteady-state inactivation of INa to\
  \ a more negative membrane potential\nby approximately -9 mV with no effect on the\
  \ slope of the inactivation\ncurve, and produce a significant prolongation in the\
  \ recovery of INa\ninactivation.  Additionally, OXC was effective in suppressing\n\
  persistent INa (INa(P)) elicited by long ramp pulses. The blockade of\nINa by OXC\
  \ does not simply reduce current magnitude, but alters\ncurrent kinetics. Moreover,\
  \ OXC could suppress the amplitude of\ndelayed rectifier K+ current (IK(DR)), with\
  \ no effect on M-type K+\ncurrent (IK(M)). In current-clamp configuration, OXC could\
  \ reduce the\namplitude of action potentials and prolong action-potential\nduration.\
  \ Furthermore, the simulations, based on hippocampal pyramidal\nneurons (Pinsky-Rinzel\
  \ model) and a network of the Hodgkin-Huxley\nmodel, were analysed to investigate\
  \ the effect of OXC on action\npotentials. Taken together, our results suggest that\
  \ the synergistic\nblocking effects on INa and IK(DR) may contribute to the underlying\n\
  mechanisms through which OXC affects neuronal function in vivo.\n\n\nTo run the\
  \ model:\nExpand the archive and cd into the newly created directory and run:\n\
  xppaut neuron\\_oxc.ode\nthen click on Initialcond -> Go\nThe potential trace is\
  \ shown in the lower part of Figure 9b in the paper of \nHuang et al (2008):\n\n\
  \n```\n![screenshot](data:image/jpeg;base64,)\n\
  ```\n\n\nThe model file was supplied by:\n\nDr. Sheng-Nan Wu\nNational Cheng Kung\
  \ University Medical College\nTainan 70101, Taiwan\nsnwu@mail.ncku.edu.tw\n\n```"
